package usecase

import (
	"context"
	"errors"
	"math/big"
	"testing"

	"github.com/golang/mock/gomock"
	"github.com/stretchr/testify/assert"

	"github.com/KyberNetwork/kyberswap-aggregator/internal/pkg/entity"
	"github.com/KyberNetwork/kyberswap-aggregator/internal/pkg/mocks/usecase"
)

var (
	ErrRandomError = errors.New("random error")
)

func TestL2FeeCalculatorUseCase_GetL1Fee(t *testing.T) {
	type args struct {
		encodedSwapData string
	}
	tests := []struct {
		name    string
		prepare func(ctrl *gomock.Controller) *L2FeeCalculatorUseCase
		args    args
		want    *big.Int
		wantErr error
	}{
		{
			name: "it should return error when chain is not L2",
			prepare: func(ctrl *gomock.Controller) *L2FeeCalculatorUseCase {
				mockScannerStateRepo := usecase.NewMockIScannerStateRepository(ctrl)

				return NewL2FeeCalculatorUseCase(nil, mockScannerStateRepo)
			},
			args: args{
				encodedSwapData: "aaa",
			},
			want:    nil,
			wantErr: ErrChainIsNotL2,
		},
		{
			name: "it should return error when can not get l2 fee from scanner state",
			prepare: func(ctrl *gomock.Controller) *L2FeeCalculatorUseCase {
				mockScannerStateRepo := usecase.NewMockIScannerStateRepository(ctrl)
				mockScannerStateRepo.
					EXPECT().
					GetL2Fee(gomock.Any()).
					Return(nil, ErrRandomError)

				mockL2FeeCalculatorRepo := usecase.NewMockIL2FeeCalculator(ctrl)

				return NewL2FeeCalculatorUseCase(mockL2FeeCalculatorRepo, mockScannerStateRepo)
			},
			args: args{
				encodedSwapData: "aaa",
			},
			want:    nil,
			wantErr: ErrRandomError,
		},
		{
			name: "it should return error when can not create raw tx from input data",
			prepare: func(ctrl *gomock.Controller) *L2FeeCalculatorUseCase {
				mockScannerStateRepo := usecase.NewMockIScannerStateRepository(ctrl)
				mockScannerStateRepo.
					EXPECT().
					GetL2Fee(gomock.Any()).
					Return(&entity.L2Fee{
						Decimals:  big.NewInt(6),
						L1BaseFee: big.NewInt(16113999481),
						Overhead:  big.NewInt(2100),
						Scalar:    big.NewInt(1000000),
					}, nil)

				mockL2FeeCalculatorRepo := usecase.NewMockIL2FeeCalculator(ctrl)

				mockL2FeeCalculatorRepo.
					EXPECT().
					SetParams(&entity.L2Fee{
						Decimals:  big.NewInt(6),
						L1BaseFee: big.NewInt(16113999481),
						Overhead:  big.NewInt(2100),
						Scalar:    big.NewInt(1000000),
					})

				mockL2FeeCalculatorRepo.
					EXPECT().
					CreateRawTxFromInputData("").
					Return(nil, ErrRandomError)

				return NewL2FeeCalculatorUseCase(mockL2FeeCalculatorRepo, mockScannerStateRepo)
			},
			args: args{
				encodedSwapData: "",
			},
			want:    nil,
			wantErr: ErrRandomError,
		},
		{
			name: "it should return nil when can not get L1 fee from input bytes",
			prepare: func(ctrl *gomock.Controller) *L2FeeCalculatorUseCase {
				mockScannerStateRepo := usecase.NewMockIScannerStateRepository(ctrl)
				mockScannerStateRepo.
					EXPECT().
					GetL2Fee(gomock.Any()).
					Return(&entity.L2Fee{
						Decimals:  big.NewInt(6),
						L1BaseFee: big.NewInt(16113999481),
						Overhead:  big.NewInt(2100),
						Scalar:    big.NewInt(1000000),
					}, nil)

				mockL2FeeCalculatorRepo := usecase.NewMockIL2FeeCalculator(ctrl)
				mockL2FeeCalculatorRepo.
					EXPECT().
					CreateRawTxFromInputData("").
					Return([]byte(""), nil)

				mockL2FeeCalculatorRepo.
					EXPECT().
					SetParams(&entity.L2Fee{
						Decimals:  big.NewInt(6),
						L1BaseFee: big.NewInt(16113999481),
						Overhead:  big.NewInt(2100),
						Scalar:    big.NewInt(1000000),
					})

				mockL2FeeCalculatorRepo.
					EXPECT().
					GetL1Fee([]byte("")).
					Return(nil)

				return NewL2FeeCalculatorUseCase(mockL2FeeCalculatorRepo, mockScannerStateRepo)
			},
			args: args{
				encodedSwapData: "",
			},
			want:    nil,
			wantErr: nil,
		},
		{
			name: "it should get L1 fee correctly for Optimism",
			prepare: func(ctrl *gomock.Controller) *L2FeeCalculatorUseCase {
				mockScannerStateRepo := usecase.NewMockIScannerStateRepository(ctrl)
				mockScannerStateRepo.
					EXPECT().
					GetL2Fee(gomock.Any()).
					Return(&entity.L2Fee{
						Decimals:  big.NewInt(6),
						L1BaseFee: big.NewInt(16113999481),
						Overhead:  big.NewInt(2100),
						Scalar:    big.NewInt(1000000),
					}, nil)

				mockL2FeeCalculatorRepo := usecase.NewMockIL2FeeCalculator(ctrl)
				mockL2FeeCalculatorRepo.
					EXPECT().
					CreateRawTxFromInputData("").
					Return([]byte(""), nil)

				mockL2FeeCalculatorRepo.
					EXPECT().
					SetParams(&entity.L2Fee{
						Decimals:  big.NewInt(6),
						L1BaseFee: big.NewInt(16113999481),
						Overhead:  big.NewInt(2100),
						Scalar:    big.NewInt(1000000),
					})

				mockL2FeeCalculatorRepo.
					EXPECT().
					GetL1Fee([]byte("")).
					Return(big.NewInt(33248))

				return NewL2FeeCalculatorUseCase(mockL2FeeCalculatorRepo, mockScannerStateRepo)
			},
			args: args{
				encodedSwapData: "",
			},
			want:    big.NewInt(33248),
			wantErr: nil,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			ctrl := gomock.NewController(t)
			defer ctrl.Finish()

			uc := tt.prepare(ctrl)

			got, err := uc.GetL1Fee(context.Background(), tt.args.encodedSwapData)

			assert.ErrorIs(t, tt.wantErr, err)
			assert.Equal(t, tt.want, got)
		})
	}
}
